import React from 'react';
import Content from "./content";
import {connect} from "react-redux";
import {AuthRedirectWith} from "../../hoc/AuthRedirect";
import {compose} from "redux";
import {addSmsActionCreator, updateNewSmsActionCreator} from "../../redux/dialogs-reducer";
let mapStateToPropsForRedirect=(state)=>{
    return {isAuth:state.Auth.isAuth};
};
let mapStateToProps = (state) => {
    return {
        profilePage: state.profilePage
    }
}
export default compose(connect(mapStateToProps),connect(mapStateToPropsForRedirect),AuthRedirectWith)(Content);
